- uid: 1292
  type: PaperCargoInvoice
  components:
  - desc: Looks like someone was in a hurry to leave you a message.
    name: hastily written note
    type: MetaData
  - pos: -1.431643,-0.49818403
    parent: 1
    type: Transform
  - content: >
      Hey, we had to evac due to a micro meteorite storm before we finished setting everything up. It couldn't be helped.

      Centcomm keeps us to a tight schedule, so we aren't coming back; you'll have to repair the station and finish where we left off to make the station fully functional.

      Lucky for you, we set up engineering, atmos, the cargo dock, the dorms, and most of the bridge.  Hopefully none of the critical systems get damaged by the incoming micro meteorites.

      The AME hasn't gotten here yet, but we never even got started on the science module anyway so it's alright I guess?

      Good luck, and get mining, Nanotrasen is watching.
    type: Paper
